import React, { Component } from 'react'

export default class Recipe extends Component {
  render() {
    return (
      <>
        {this.props.recipes.map(val => 
          <div className='col-md-4 my-3'>
              <h4>{val.title}</h4>
          </div>
        
        )}
      </>
    )
  }
}
